import React from "react";
import githubIcon from "../../images/social/github-icon.svg";
import facebookIcon from "../../images/social/facebook-icon.svg";

function About() {
  return (
      <section className="footer">
          <p className="footer__copyright">&copy; 2020  Supersite, Powered by News API</p>
          <nav className="footer__nav">
             <ul className="footer__links">
                 <li className="footer__row">
                 <a href="/" class="footer__link">Главная</a>
                 </li>
                 <li className="footer__row">
                 <a href="https://praktikum.yandex.ru/" class="footer__link">Яндекс.Практикум</a>
                 </li>
                 </ul> 
              </nav>  
      </section>

  );
}

export default About;
